subSubSection.paragraph:
Male terminalia
. Apices of ventral and dorsal median lobes rounded; ventral lobe slightly shorter than or as long as dorsal lobe; spined region of internal sac divided into two sections: first section with mixture of dense simple spines and multi-branched spines along side areas; second section with sparse short simple spines (
Fig. 81a
). Eighth sternite strongly obliquely truncate at sides, widely and deeply emarginate at apex, with long setae arising terminally; ventral surface with dense cloud-like processes (
Fig. 81b
). Eighth tergite truncate or slightly emarginate at apex, with some short simple spines and multi-branched spines on mid area (
Fig. 81c
). Paramere 1.46–1.48 × as long as wide, cylindrical in shape; apex rounded with long and short setae (
Fig. 81d
).

Ovipositor and spermatheca.
Ovipositor short; styli arising terminally with short hairs (
Fig. 81e
). Spermatheca slightly curved; spermathecal gland arising at base (
Fig. 81f
).
